import { LOCALES } from "../locales";

export default {
    [LOCALES.English]:{
        'hello':'Hello ',
        'greeting':'Hi {path}',
        'logo':'React Market',
        'home':'Home',
        'list':'Products',
        'contact':'Contact',
        'animation':'Animation',
        'login':'Login',
        'register':'Registration',
        'uz':"Uzbek",
        'ru':'Russian',
        'en':'English',
        'username':'Username',
        'password':'Password',
        'submit':'Submit',
        'email':'Email',
        'confirm_pass':'Confirmation Password',
        'map':'Map',
        form:{
            email:{
                placeholder:'Your email'
            }
        }
    }
}
